export default function WorkBar(props) {
    const colors = ['white', 'red', 'green', 'blue', 'black'];
    
    const colorsBtns = colors.map(data => (<button onClick={() => props.setCurrentColor(data)}>{data}</button>))

    return (
        <div>
            <p>`currentColor : {props.currentColor}`</p>
            {colorsBtns}
        </div>
    )
}
